//Assigning menuItems for Drop down list of Experience having title, path cName as attributes
export const MenuItems = [
    {
        title: "Drop a review",
        path: "/review",
        cName: 'dropdown-link'

    },
    {
        title: "Post photos",
        path: "/post",
        cName: 'dropdown-link'
    }

]
